import Navigation from "./Navigation";
export default function PricingPage() {
      const plans = [
    {
      name: 'Free',
      price: '$0',
      period: 'forever',
    //   description: 'Perfect for trying out the platform',
      features: [
        'Access to one station',
        'Personalised feedback',
      ],
      cta: 'Get Started',
      highlighted: false,
    },
    {
      name: 'Pay as you go',
      price: '$xxxx',
      period: 'one off',
      credits:'For 200 credits(minutes)',
    //   description: 'Ideal for medical students preparing for interviews',
      features: [
        'Access to x stations',
        'Personalised feedback',
        'Saved progress',
        'Other random things',
        'Further top-ups at £ xx/credit',
      ],
      cta: 'Start Free Trial',
      highlighted: true,
    },
    {
      name: 'Subscription',
      price: '$xxxx',
      period: 'per month',
    //   description: 'For residents and professionals',

      features: [
        'Everything in Student plan',
        'Advanced interview scenarios',
        'Specialty-specific questions',
        'Custom question creation',
        'Export interview reports',
        'Priority chat support',
        '1-on-1 coaching session (monthly)',
      ],
      cta: 'Start Free Trial',
      highlighted: false,
    },
  ];

  return (
    <div>
      <Navigation />

      <section className="container mx-auto px-4 py-20">
        <div className="text-center mb-16">
          <h1 className="mb-4">Simple, Transparent Pricing</h1>
          <p className="text-xl text-gray-600 max-w-2xl mx-auto">
            Choose the plan that's right for you.
          </p>
        </div>


      </section>
    </div>
  );
}
